import React from "react";
import ReactDOM from "react-dom/client";
// import './index.css';
import App from "./App";

//Import Charkra UI(Tiffany)
import { theme, ThemeProvider, CSSReset } from "@chakra-ui/core"; 

// const root = ReactDOM.createRoot(document.getElementById("root"));
// root.render(
//   <React.StrictMode>
//       <App />
